import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { QueryClient, QueryClientProvider } from '@tanstack/react-query'; // ⬅️ Add this

const queryClient = new QueryClient(); // ⬅️ Create a new QueryClient instance

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <QueryClientProvider client={queryClient}> {/* ⬅️ Wrap your App here */}
      <App />
    </QueryClientProvider>
  </React.StrictMode>
);

reportWebVitals();
